import Grid from '@material-ui/core/Grid';
import React from 'react';
import {StyleSheet} from 'react-native';
import HeaderV from './Header';
import LineChartV from './LineChart';
import NavbarV from './Navbar';
import RadarChartV from './RadarChart';
const Mystyle={
  chartstyle:{
    width:'600px',
    backgroundColor:'white',
    margin:'5px'
  }
}
function DashboardV() {
  return (
    <div  style={{backgroundColor:'#eee'}}>
      <HeaderV/>
      <Grid container >
        <Grid>
        <Grid item xs={12} sm={9} md={3} >
        <NavbarV/>
        </Grid>
        </Grid>
        <Grid >
        <Grid container>
        <Grid item xs={6} sm={9} md={5} style={StyleSheet.flatten([Mystyle.chartstyle])}>
      <LineChartV/>
      </Grid>
      <Grid item xs={6} sm={9} md={5} style={StyleSheet.flatten([Mystyle.chartstyle])}>
       <RadarChartV/>
     </Grid>
     </Grid>
     <Grid container>
     <Grid item xs={6} sm={9} md={5}  style={StyleSheet.flatten([Mystyle.chartstyle])}>
      <LineChartV/>
      </Grid>
      <Grid item xs={6} sm={9} md={5} style={StyleSheet.flatten([Mystyle.chartstyle])}>
      <LineChartV/>
      </Grid>
      </Grid>
      </Grid>
          </Grid>
</div>
  );
}
export default DashboardV;
